 import time, random
def retry_with_backoff(func, max_retries=5, base_delay=1):
    for attempt in range(max_retries):
        try: return func()
        except Exception as e:
            if attempt == max_retries - 1: raise
            delay = base_delay * (2 ** attempt) + random.uniform(0, 1)
            time.sleep(delay)
